import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './App.css';
import Form1 from './Components/Form1';
import Login from './Components/Login'
function App() {
  return (
    <div className="App">
      {/* <Temp /> */}


    <Router>
        <Routes>
        <Route  path="/F" element={<Form1 />} />
        <Route  path="/" element={<Login />} />
        </Routes>
        </Router>
    </div>
  );
}

export default App;
